*/


class App extends Component {

  state = {
    cases: []
  }

  componentDidMount() {
    axios.post('http://api.home:8080/casa/llegir')
      .then(res => {
        const cases = res.data;
        this.setState({ cases });
    })
  }

  render() {
    return (
      <div>
        <CarouselCards key="carouselCards" cases={this.state.cases}/>

      </div>
    );
  }
}

export default App;
